import React from 'react';

class MyContacts extends React.Component {

    constructor(props) {
        super(props);
    }

    componentDidMount(){
        const loggingIn = localStorage.getItem('user-token');
        if(!loggingIn){
          this.props.history.push("/");
        }
    }

    render() {
        return (
        <nav className="navbar navbar-inverse">
        <div className="container-fluid">
          <div className="navbar-header">
            <a className="navbar-brand" href="#">WebSiteName</a>
          </div>
          <ul className="nav navbar-nav">
            <li className="active"><a href="#">Home</a></li>
            <li><a href="#">Page 1</a></li>
            <li><a href="#">Page 2</a></li>
          </ul>
          <ul className="nav navbar-nav navbar-right">
            <li><a href="#"><span className="glyphicon glyphicon-user" /> Sign Up</a></li>
            <li><a href="#"><span className="glyphicon glyphicon-log-in" /> Login</a></li>
          </ul>
        </div>
      </nav>
        );
    }
}

export default MyContacts;
